class Solution {

    /**
     * @param String $s
     * @param Integer $k
     * @return Integer
     */
    function beautifulSubstrings($s, $k) {
        $n = strlen($s);
        $count = 0;
        for ($i = 0; $i < $n; $i++) {
            $vowels = $consonants = 0;
            for ($j = $i; $j < $n; $j++) {
                if (in_array($s[$j], ['a', 'e', 'i', 'o', 'u'])) {
                    $vowels++;
                } else {
                    $consonants++;
                }
                if ($vowels == $consonants && ($vowels * $consonants) % $k == 0) {
                    $count++;
                }
            }
        }
        return $count;
    }
}
